import React from 'react';
import ReactDOM from 'react-dom/client';

// --- TEMPORARY TEST COMPONENT ---
// This test component is guaranteed to render if React is working.
const TestApp = () => {
    // Note: Tailwind is loaded via index.html
    return (
        <div className="flex items-center justify-center min-h-screen bg-gray-100 dark:bg-gray-800 transition-colors duration-300">
            <h1 className="text-3xl font-bold text-green-600 dark:text-green-400">
                âœ… REACT TEST SUCCESSFUL!
            </h1>
            <p className="ml-4 text-gray-700 dark:text-gray-300">
                (The structural problem is fixed.)
            </p>
        </div>
    );
};
// --- END TEMPORARY TEST COMPONENT ---

// Create the root element and render the test app inside it.
const rootElement = document.getElementById('root');
if (rootElement) {
    const root = ReactDOM.createRoot(rootElement);
    root.render(
        <React.StrictMode>
            <TestApp />
        </React.StrictMode>
    );
} else {
    console.error("Failed to find the root element with ID 'root' in index.html.");
}
